配電盤の配線にクランプを挟むだけの簡単設置で全体の電力を測定出来ます。<br>
しかも無線式なので表示機の設置場所は自由！<br>節電省エネ活動に頼れる強い味方です。<br>
ＰＣソフトウェア”eLink”で分析も簡単。<br><br>

